import { useEffect, useState } from 'react'
import "./Details.css"

export const StaffList = () => {

    const [staff, setStaff] = useState([])
    const [staffTitles, setTitle] = useState([])

    useEffect(
        () => {
            fetch(`http://localhost:8088/staff?&_expand=user`)
                .then(response => response.json())
                .then((staffArray) => {
                    setStaff(staffArray)
                })
        }, 
        []
    )

    useEffect(
        () => {
            fetch(`http://localhost:8088/staffTitles?&_expand=title&_expand=staff`)
                .then(response => response.json())
                .then((titleArray) => {
                    setTitle(titleArray)
                })

        }, 
        []
    )



    return (
        <div className="staffPage">
            <h2 className="staffHeader">Our Staff</h2>
            <div className="staffMembers">
                {
                    staff.map((staff) => {
                        return <div className="staff" key={`staff--${staff.id}`}>

                            <img src={staff.imageURL} />
                            <div> {staff?.user?.fullName}</div>
                            {staffTitles.map(staffTitle)}



                        </div>
                    })
                }
            </div>
        </div>
    )
}
